import React, { Component } from 'react';

class Rect extends Component {
  constructor(props) {
    super(props);
    this.x = props.x;
    this.y = props.y;
    this.width = props.w;
    this.height = props.h;
    this.color = props.c;
    this.style = {
      backgroundColor: this.color,
      position: "absolute",
      left: this.x + "px",
      top: this.y + "px",
      width: this.width + "px",
      height: this.height+ "px"
    }
  }

  render() {
    return <div style={this.style}></div>;
  }
}

export default Rect;
